import React from "react";
import  {Updatestate} from '../index'
import axios from 'axios';
class Lists extends React.Component{
constructor(props){
    super(props);
    this.state={
        data:{},
        userdata:{},
        carddata:{}
    }
    //this.logindata=this.logindata.bind(this)
   // this.check=this.check.bind(this)
 console.log(this.props)
}
    logindata(){
 //    this.setState({userdata:this.props.datalog})
    }
    componentDidMount(){
        console.log('entered viewing lists')
        //console.log(this.props.logined.data)
        console.log(this.props.logineddata.data.data.userDetails.userId)

      axios
      .get('http://127.0.0.1:3000/api/v1/lists/all/'+this.props.logineddata.data.data.userDetails.userId+'/'+this.props.logineddata.data.data.authToken)
      .then(response =>{
          console.log(response.data)
          this.setState({data:response.data})
          let actualdata;
          actualdata=(this.state.data).map((cd)=><Card data={cd}/>)
        this.setState({carddata:actualdata})
           console.log('response got')

        })
      .catch(error=>{console.log('error')})
      }
     Card(props){
         return(
            <html>

            <head>
                <link rel="stylesheet" href="https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css"
                    integrity="sha384-ggOyR0iXCbMQv3Xipma34MD+dH/1fQ784/j6cY/iJTQUOhcWr7x9JvoRxT2MZw1T" crossorigin="anonymous" />
            
            
                </head>
            
            <body>
                <div style={{marginBottom: "10%"}}>
                    <nav className="navbar navbar-expand-lg navbar-dark bg-#04192E" style={{backgroundColor:"#04192E"}}>
                        <a className="navbar-brand" href="#">ToDo List</a>
                        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup"
                            aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
                            <span class="navbar-toggler-icon"></span>
                        </button>
                        <div className="collapse navbar-collapse" id="navbarNavAltMarkup">
                            <div className="navbar-nav" style={{marginLeft:"50%"}}>
                                <a className="nav-item nav-link active" >ViewLists <span
                                        className="sr-only">(current)</span></a>
                                <a className="nav-item nav-link">CreateLists</a>
                                <a className="nav-item nav-link" >Logout</a>
                            </div>
                        </div>
                    </nav>
                </div>
                <div>
                    <div>
            
                    </div>
                </div>
                <div className="shadow p-3 mb-5 bg-white rounded">
                   <div className="container">
                     <div className="row" >
                            <div className="col-md-4">
            
                        <div className="card text-white bg-info " style={{maxWidth: "18rem",marginBottom: "5%"}}>
                                   
                                    <div className="card-body">
                                            <h5 className="card-title">{this.props.cd.title}</h5>
                                            <small className="text"  style={{fontFamily: "Comic Sans MS",marginLeft: "50%"}}>{}</small>
                                            <hr/>
                                            <p className="card-text">{this.props.cd.description}</p>
                                                        <a href="/view" className="btn btn-dark" style={{marginRight: "5%",width:"30%"}}>Edit</a>
                                                        <a href="#" className="btn btn-dark"  style={{marginRight: "5%",width:"30%" }} >View</a>
                                                        <button   className="btn btn-dark"  style={{width:"30%" }}>Delete</button>
                                            <p className="card-text" >
                                                <small className="text"  style="font-family: Comic Sans MS;margin-left: 50%">Created {}</small>
                                            </p>
                                        </div>
                                    </div>
                            </div>
                        </div>   
                </div>
            </div>
            </body>
            
            </html>
         )
      }

render(){
    return(

        <div>

            {this.state.carddata}
        </div>
        
    )
   // Updatestate({viewlists:false})

}
}

export default Lists
